import React from "react";
import Header from "./components/Header";
import Menu from "./components/Menu";
import Footer from "./components/Footer";
// import Content from "./components/Content";
import Dashboardv1 from './Screens/Dashboardv1';
import Dashboardv2 from './Screens/Dashboardv2';
import Dashboardv3 from './Screens/Dashboardv3';
import Widgets from './Screens/Widgets';
import{
  BrowserRouter as Router,
  Route,
  Link,Switch
} from 'react-router-dom';


export default function App() {
  return (
    <div>
          <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/dashboardv1">Home</Link>
            </li>
            <li>
              <Link to="/dashboardv2">About</Link>
            </li>
            <li>
              <Link to="/dashboardv3">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <Dashboardv1 />
          </Route>
          <Route path="/users">
            <Dashboardv2 />
          </Route>
          <Route path="/">
            <Dashboardv2 />
          </Route>
        </Switch>
      </div>
    </Router>

    </div>
  );
}
